  return (
    <div>
      <Words>
        내가 선택한 단어 <Search></Search>
        <hr />
        <Row gutter={16}>
          {me !== null &&
            me.dairies.map((a, i) => {
              return (
                <Col key={i} className="gutter-row" span={6}>
                  {a.word}
                </Col>
              )

              // <div key={i}>{a.word}</div>
            })}
        </Row>
      </Words>
    </div>
  )
}
export default PickWords
